import classes from './Overview.module.css';

import InstructorUnit from './InstructorUnit';
import InfoUnit from './InfoUnit';

import About from './About';
import {GiDogHouse,GiProgression} from 'react-icons/gi';
import {BsPeopleFill} from 'react-icons/bs';
import {FaHandPointRight,FaCodiepie} from 'react-icons/fa';
import {GrStatusGoodSmall} from 'react-icons/gr';
import {FaBarcode} from 'react-icons/fa';
import {AiOutlineFieldTime} from 'react-icons/ai';

import {MdTimelapse} from 'react-icons/md';



const Overview=()=>{



return (

<div className={classes.overview}>

     <div className={classes.instructorGrid}>
        <InstructorUnit/>
     </div>


     <div className={classes.generalInfoGrid}>


          <InfoUnit 
	         name="Institute" 
	         value="Kalinga Institute of Industrial Technology, Bhubaneswar, Odisha"
	         icon={GiDogHouse}
	         />

          <InfoUnit
                  name="Designed for"
                  value="Class-11"
	          icon={FaHandPointRight}
                  />

          <InfoUnit
                  name="No. of Students"
                  value="20"
	          icon={BsPeopleFill}
                  />



          <InfoUnit
	           name="Status"
	           value="ongoing"
	           icon={GrStatusGoodSmall}
	          />

          <InfoUnit
                   name="Institute code"
                   value="CS223"
	           icon={FaBarcode}
                  />

          <InfoUnit
                   name="Duration"
                   value="22/05/2022 to 20/10/2022"
                   icon={FaCodiepie}
                  />

          <InfoUnit
                   name="Progress"
                   value="40% complete"
                   icon={GiProgression}
                  />

          <InfoUnit
                   name="Upcoming class"
                   value="9:30 am, Monday"
                   icon={GiDogHouse}
                  />


          <InfoUnit
                   name="Credit"
                   value="100 marks"
                   icon={GiDogHouse}
                  />


          <InfoUnit
                   name="Credit"
                   value="100 marks"
                   icon={GiDogHouse}
                  />

          <InfoUnit
                   name="No pf Exams"
                   value="2"
                   icon={GiDogHouse}
                  />

	  <InfoUnit
                   name="Pending Assignments"
                   value="1"
                   icon={GiDogHouse}
                  />






     </div>



     <div className={classes.aboutTheCourse}>

          <About/>

     </div>


     <div className={classes.recoBooks}>

          <div> Reccommended books</div>
          <div> Concept of Physics, HC Verma</div>

     </div>












</div>

);

}

export default Overview;
